def int_to_mini_roman(number):
    numbers = [1000, 900, 500, 400, 100, 90, 50, 40, 10, 9, 5, 4, 1]
    symbols = ['m', 'cm', 'd', 'cd', 'c', 'xc', 'l', 'xl', 'x', 'ix', 'v', 'iv', 'i']
    result = ''
    for i in range(len(numbers)):
        while number >= numbers[i]:
            number -= numbers[i]
            result += symbols[i]

